import './Checkout.css'
import React from 'react'

function Checkout() {
  return (
    <div className='checkout'>
      <div className='checkout__left'>
        <img className='checkout__ad' src='https://m.media-amazon.com/images/I/71zBGVPtAKL._SX3000_.jpg'></img>

      </div>

    </div>
  )
}

export default Checkout
